import React from "react";
import { ProductForm } from "../UI/ProductForm/ProductForm";
import img from "../img/catalog1.jpg"


export const Catalog1=()=>{ 

 const catalog= [
    {id:Date.now(), title:"Запчасть 1",description:"this is a greatphone", price:"100", img:img},
    {id:Date.now(), title:"Запчасть 2",description:"this is a greatphone", price:"300",img:img},
    {id:Date.now(),title:"Запчасть 3",description:"this is a greatphone", price:"700",img:img},
    {id:Date.now(), title:"Запчасть 4",description:"this is a greatphone", price:"1000",img:img},
    {id:Date.now(), title:"Запчасть 5",description:"this is a greatphone", price:"300",img:img}]


    return( 
        <div className="whole">
            {catalog.map((p)=>
            
                     <ProductForm p={p}  ></ProductForm>)
             }
        </div>
    )
}
